import React from 'react';
import {
  Container,
  List,
  ListItem,
  ListItemText
  } from '@material-ui/core';

import { privacyData } from '../data';

function PrivacyContainer(){
  return(
    <Container>
      <List>
      {privacyData.map((item) => {
        <ListItem>
          <ListItemText>{item.type}</ListItemText>
        </ListItem>
      })}
      </List>
    </Container>
  );
};

export default PrivacyContainer;
